import React, { useState, useEffect } from "react";

function Nav(props) {
	const { navLinks = [], setCurrentNavLink, currentNavLink } = props;

	return (
		<nav>
			<ul className="flex-row">
				<li className="mx-1" key="About Me">
					<span
						onClick={() => {
							setCurrentNavLink(navLinks[0]);
						}}
					>
						About Me
					</span>
				</li>
				<li className="mx-1" key="Portfolio">
					<span
						onClick={() => {
							setCurrentNavLink(navLinks[1]);
						}}
					>
						Portfolio
					</span>
				</li>
				<li className="mx-1" key="Contact">
					<span
						onClick={() => {
							setCurrentNavLink(navLinks[2]);
						}}
					>
						Contact
					</span>
				</li>
				<li className="mx-1" key="Resume">
					<span
						onClick={() => {
							setCurrentNavLink(navLinks[3]);
						}}
					>
						Resume
					</span>
				</li>
			</ul>
		</nav>
	);
}

export default Nav;
